import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";


function Entries() {
  return (
    <dl className="dictionary">
      <div>{emojipedia.map(entry => (
        <Entry
        key={entry.id}
        emoji={entry.emoji}
        name={entry.name}
        meaning={entry.meaning}
      />
      ))}</div>
    </dl>
  );
}

export default Entries;
